import logo from './logo.svg';
import React from 'react';
import Routes from 'react-router-dom';
import Route from 'react-router-dom';
import './App.css';

function App() {
  return (
    <div className="App">
      <header>
        <nav>
          <a href="/">Accueil</a>
          <a href="about">A propos</a>
        </nav>
      </header>
      <main>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="about" element={<About />} />
        </Routes>
      </main>
    </div>
  );
}

export default App;
